Blockly.Msg.TOUR1_DESCRIPTION06 = "Clica aqui para voltar ao ambiente de programação!";
Blockly.Msg.TOUR1_DESCRIPTION07 = "A caixa de ferramentas. <br>Aqui encontras todos os blocos de programação.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "Once you are an experienced user you can switch here to the expert mode of the toolbox.<br>You will then find more blocks to program your robot.<br><span class='typcn typcn-media-stop-outline'></span> beginner mode<br><span class='typcn typcn-star-outline'></span> expert mode";  // untranslated
Blockly.Msg.TOUR1_DESCRIPTION08 = "Um programa começa com o bloco »início«.<br>Outros blocos de programação para o robô executar, devem ser ligados a este bloco inicial.<br>Arrasta o bloco desejado e coloca-o por baixo do bloco início.";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Aqui encontras alguns atalhos!<br>Da esquerda para a direita:<br><span class='typcn typcn-media-play'></span> Clica aqui para executar o programa no robô real<br><span class='typcn typcn-media-play-outline'></span> Clica aqui para arrancar o robô na simulação<br><span class='typcn typcn-cloud-storage'></span> Guarda o teu programa, mas antes tens que iniciar sessão<br><span class='typcn typcn-zoom'></span> Cica aqui para aumentar os blocos, se assim o desejares<br><span class='typcn typcn-archive'></span> O caixote do lixo! Move os blocos para o lixo e serão apagados.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Atenção: Não podes recuperar blocos que foram apagados!<br>";
